    playbackData.comments = {"ev-0":[{"id":"commentId-0","displayCommentEvent":{"id":"ev-0","timestamp":1647472933447,"createdByDevGroupId":"devGroupId-1","eventSequenceNumber":0,"permanentRelevance":"never relevant","type":"CREATE DIRECTORY","directoryId":"dirId-0","directoryPath":"/","parentDirectoryId":null},"developerGroupId":"devGroupId-1","timestamp":1647540616805,"commentText":"<div>This playbacks describes creating indexes in a database. A database index is a lot like an index in the back of a textbook. At the cost of a few extra pages at the end of the book you can quickly look up terms to find what pages they are on in the book. Without the index searching for topics in a book would be prohibitively expensive. With the index, it is practically trivial.<br></div><div><br></div><div>Similarly, with a database index, at the cost of some extra storage space to hold the index data the DBMS's query planner can use it to significantly speed up certain queries. It is up to the database developers to decide which values to place in an index.<br></div>","selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":"0","linesBelow":"0","currentFilePath":"","viewableBlogText":"","commentTags":[],"questionCommentData":{"allAnswers":[],"correctAnswer":"","question":""}}],"ev-40":[{"id":"commentId-1","displayCommentEvent":{"id":"ev-40","timestamp":1647472959043,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":40,"type":"INSERT","fileId":"fileId-0","character":";","previousNeighborId":"ev-39","lineNumber":3,"column":20,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1647541326590,"commentText":"<div>In SQLite, every row in every table has an attribute called <font face=\"Courier\">rowId</font>. If you have the DBMS generate your <font face=\"Courier\">INTEGER PRIMARY KEY</font>s then this <font face=\"Courier\">rowId</font> is used as the primary key.</div><div><br></div><div>The DBMS keeps the rows in <font face=\"Courier\">rowId</font> order. Not all of the values are necessarily sequential (<font face=\"Courier\">rowId</font>=1, <font face=\"Courier\">rowId</font>=2, <font face=\"Courier\">rowId</font>=3, etc.) because some rows may be deleted with the <font face=\"Courier\">DELETE</font> command. However, all of the rows in all of the tables are ordered by this value.<br></div>","selectedCodeBlocks":[],"imageURLs":["media/images/1647541283217-IMG_8BF6559A063E-1.jpeg"],"videoURLs":[],"audioURLs":[],"linesAbove":"3","linesBelow":"3","currentFilePath":"/q1.sql","viewableBlogText":"","commentTags":[],"questionCommentData":{"allAnswers":[],"correctAnswer":"","question":""}},{"id":"commentId-2","displayCommentEvent":{"id":"ev-40","timestamp":1647472959043,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":40,"type":"INSERT","fileId":"fileId-0","character":";","previousNeighborId":"ev-39","lineNumber":3,"column":20,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1647478531090,"commentText":"<div>In order for the DBMS to execute this query the <i>query planner</i> needs to come up with a plan to find all of the Labs in the Dogs table.</div><div><br></div><div>The best that the query planner can do in this case is to do a full table scan of the Dogs table. This means that it will look at every row in the Dogs table and it will collect all the rows where the <font face=\"Courier\">breed</font> is equal to Lab.<br></div>","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"WHERE breed = \"Lab\"","startRow":2,"startColumn":0,"endRow":2,"endColumn":19}],"imageURLs":["media/images/1647475356151-Screen Shot 2022-03-16 at 6.16.48 PM.png"],"videoURLs":[],"audioURLs":[],"linesAbove":"2","linesBelow":"0","currentFilePath":"/q1.sql","viewableBlogText":"SELECT *\nFROM Dogs\nWHERE breed = \"Lab\";","commentTags":[],"questionCommentData":{"allAnswers":[],"correctAnswer":"","question":""}}],"ev-59":[{"id":"commentId-3","displayCommentEvent":{"id":"ev-59","timestamp":1647472972981,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":59,"type":"INSERT","fileId":"fileId-0","character":"NEWLINE","previousNeighborId":"ev-58","lineNumber":1,"column":19,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1647541433390,"commentText":"<div>I know that this is the case because I can ask the DBMS what the query planner came up with. All you have to do is add <font face=\"Courier\">EXPLAIN QUERY PLAN</font> before any query. <br></div><div><br></div><div>The attached screenshot shows that a full table scan is the plan that the DBMS came up with to execute this query.<br></div>","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"EXPLAIN QUERY PLAN","startRow":0,"startColumn":0,"endRow":0,"endColumn":18}],"imageURLs":["media/images/1647475495279-Screen Shot 2022-03-16 at 6.17.15 PM.png"],"videoURLs":[],"audioURLs":[],"linesAbove":"0","linesBelow":"3","currentFilePath":"/q1.sql","viewableBlogText":"EXPLAIN QUERY PLAN\nSELECT *\nFROM Dogs\nWHERE breed = \"Lab\";","commentTags":[],"questionCommentData":{"allAnswers":[],"correctAnswer":"","question":""}}],"ev-99":[{"id":"commentId-4","displayCommentEvent":{"id":"ev-99","timestamp":1647472990007,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":99,"type":"INSERT","fileId":"fileId-1","character":";","previousNeighborId":"ev-98","lineNumber":1,"column":39,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1647541622987,"commentText":"If the query planner knows the <font face=\"Courier\">rowId</font> of what you are looking for it can drastically improve the performance of a search. It uses data structures and algorithms that make searching through an ordered collection very, very fast.<div><br></div><div>The problem is that <font face=\"Courier\">rowId</font>s are usually not meaningful. Will anyone at the pet adoption center even know which dog has the id equal to 12? Probably not. An index maps the meaningful attributes of a table to <font face=\"Courier\">rowId</font>s. <br></div><div><br></div><div>Imagine you have a phone book with 10 million names in it (it would be pretty darn thick). If I asked you to search for a name you would be able to find it (or tell me the name was not in it) in just a few seconds. <br></div><div><br></div><div>How is that possible? Because phone books are sorted alphabetically and after checking each name for a match you can throw out half of the remaining names. This is the same approach that is used with an index.<br></div>","selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":"0","linesBelow":"0","currentFilePath":"/breedIndex.sql","viewableBlogText":"","commentTags":[],"questionCommentData":{"allAnswers":[],"correctAnswer":"","question":""}},{"id":"commentId-5","displayCommentEvent":{"id":"ev-99","timestamp":1647472990007,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":99,"type":"INSERT","fileId":"fileId-1","character":";","previousNeighborId":"ev-98","lineNumber":1,"column":39,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1647476415842,"commentText":"<div>This SQL command asks the DBMS to create an index on the Dogs table that will hold all of the breeds in alphabetic order with a link to the <font face=\"Courier\">rowId</font> where to find the full row in the Dogs table (see the attached picture).</div><div><br></div><div>The great advantage the query planner now has is that it can use a 'phone book search' to find a particular breed (or group of rows with the same breed since all duplicates will be right next to each other). Once it knows the <font face=\"Courier\">rowId</font>s then it can do another 'phone book search' on the ordered <font face=\"Courier\">rowId</font>s in the Dogs table.<br></div>","selectedCodeBlocks":[{"fileId":"fileId-1","selectedText":"CREATE INDEX BreedIndex ON Dogs(breed)","startRow":0,"startColumn":0,"endRow":0,"endColumn":38}],"imageURLs":["media/images/1647476254628-IMG_39F6C3B5AB34-1.jpeg"],"videoURLs":[],"audioURLs":[],"linesAbove":"0","linesBelow":"0","currentFilePath":"/breedIndex.sql","viewableBlogText":"CREATE INDEX BreedIndex ON Dogs(breed);","commentTags":[],"questionCommentData":{"allAnswers":[],"correctAnswer":"","question":""}},{"id":"commentId-6","displayCommentEvent":{"id":"ev-99","timestamp":1647472990007,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":99,"type":"INSERT","fileId":"fileId-1","character":";","previousNeighborId":"ev-98","lineNumber":1,"column":39,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1647476554309,"commentText":"<div>When executing this query:</div><div><font face=\"Courier\"><br></font></div><div><font face=\"Courier\">SELECT *<br>FROM Dogs<br>WHERE breed = \"Lab\";</font></div><div><br></div><div>the query planner uses the index to quickly find the Labs rather than having to go through every single row of the Dogs table. When there is a lot of data in a table this is a significant improvement.<br></div>","selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":"3","linesBelow":"3","currentFilePath":"/breedIndex.sql","viewableBlogText":"","commentTags":[],"questionCommentData":{"allAnswers":[],"correctAnswer":"","question":""}},{"id":"commentId-7","displayCommentEvent":{"id":"ev-99","timestamp":1647472990007,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":99,"type":"INSERT","fileId":"fileId-1","character":";","previousNeighborId":"ev-98","lineNumber":1,"column":39,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1647541747962,"commentText":"When I run this query again you can see that the plan is different from the last time I ran it. It is using the newly created index to speed up the search. This is like going from an unordered phone book to an ordered one.<br>","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"EXPLAIN QUERY PLAN","startRow":0,"startColumn":0,"endRow":0,"endColumn":18}],"imageURLs":["media/images/1647476602747-Screen Shot 2022-03-16 at 6.17.54 PM.png"],"videoURLs":[],"audioURLs":[],"linesAbove":"0","linesBelow":"3","currentFilePath":"/q1.sql","viewableBlogText":"EXPLAIN QUERY PLAN\nSELECT *\nFROM Dogs\nWHERE breed = \"Lab\";","commentTags":[],"questionCommentData":{"allAnswers":[],"correctAnswer":"","question":""}}],"ev-151":[{"id":"commentId-8","displayCommentEvent":{"id":"ev-151","timestamp":1647473010838,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":151,"type":"INSERT","fileId":"fileId-2","character":";","previousNeighborId":"ev-150","lineNumber":1,"column":51,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1647541989925,"commentText":"<div>Now, I'll create another index. This time I'll use the dogs' temperament to sort the index (see the attached picture).</div><div><br></div><div>One question that often comes up is, \"what indexes should I build in my database?\"</div><div><br></div><div>This is an interesting question because each index takes up some space in the database (just like a book's index costs a few extra pages at the end of the book). In the attached picture you&nbsp; can see that an index will have as many rows as the table it is indexing. <br></div><div><br></div><div><div>A further complication is that inserts, updates, and deletes affect the indexes and require extra work when they are executed on a table with an index.<br></div></div><div><br></div><div>So, you only want to create high value indexes. What is 'high value'? You have to experiment with your queries to see which ones are taking unacceptably long times to complete and target your indexes for those queries.</div>","selectedCodeBlocks":[{"fileId":"fileId-2","selectedText":"CREATE INDEX TemperamentIndex ON Dogs(temperament)","startRow":0,"startColumn":0,"endRow":0,"endColumn":50}],"imageURLs":["media/images/1647476847636-IMG_6F7C9521602B-1.jpeg"],"videoURLs":[],"audioURLs":[],"linesAbove":"0","linesBelow":"0","currentFilePath":"/temperamentIndex.sql","viewableBlogText":"CREATE INDEX TemperamentIndex ON Dogs(temperament);","commentTags":[],"questionCommentData":{"allAnswers":[],"correctAnswer":"","question":""}}],"ev-198":[{"id":"commentId-9","displayCommentEvent":{"id":"ev-198","timestamp":1647473033858,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":198,"type":"INSERT","fileId":"fileId-3","character":";","previousNeighborId":"ev-197","lineNumber":3,"column":27,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1647476985590,"commentText":"The query planner will now use the index to execute this query avoiding a table scan.<br>","selectedCodeBlocks":[{"fileId":"fileId-3","selectedText":"SELECT *\nFROM Dogs\nWHERE temperament = \"Calm\"","startRow":0,"startColumn":0,"endRow":2,"endColumn":26}],"imageURLs":["media/images/1647476968928-Screen Shot 2022-03-16 at 6.18.38 PM.png"],"videoURLs":[],"audioURLs":[],"linesAbove":"0","linesBelow":"0","currentFilePath":"/q2.sql","viewableBlogText":"SELECT *\nFROM Dogs\nWHERE temperament = \"Calm\";","commentTags":[],"questionCommentData":{"allAnswers":[],"correctAnswer":"","question":""}}],"ev-217":[{"id":"commentId-10","displayCommentEvent":{"id":"ev-217","timestamp":1647473045497,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":217,"type":"INSERT","fileId":"fileId-3","character":"NEWLINE","previousNeighborId":"ev-216","lineNumber":1,"column":19,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1647477033679,"commentText":"The attached screenshot shows that the index is being used.<br>","selectedCodeBlocks":[{"fileId":"fileId-3","selectedText":"EXPLAIN QUERY PLAN","startRow":0,"startColumn":0,"endRow":0,"endColumn":18}],"imageURLs":["media/images/1647477004845-Screen Shot 2022-03-16 at 6.19.00 PM.png"],"videoURLs":[],"audioURLs":[],"linesAbove":"0","linesBelow":"3","currentFilePath":"/q2.sql","viewableBlogText":"EXPLAIN QUERY PLAN\nSELECT *\nFROM Dogs\nWHERE temperament = \"Calm\";","commentTags":[],"questionCommentData":{"allAnswers":[],"correctAnswer":"","question":""}}],"ev-281":[{"id":"commentId-11","displayCommentEvent":{"id":"ev-281","timestamp":1647473068460,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":281,"type":"INSERT","fileId":"fileId-4","character":";","previousNeighborId":"ev-280","lineNumber":1,"column":63,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1647477240929,"commentText":"<div>You can create multi-attribute indexes if you notice that a slow query or queries are always using the same attributes. This index will first sort by breed and then for all of the dogs of the same <font face=\"Courier\">breed</font> they will be sorted by <font face=\"Courier\">temperament</font>.</div><div><br></div><div>The attached picture shows the index. If a query involves the breed and temperament then the query planner will use this index to speed up the search.<br></div>","selectedCodeBlocks":[{"fileId":"fileId-4","selectedText":"CREATE INDEX BreedTemperamentIndex ON Dogs(breed, temperament)","startRow":0,"startColumn":0,"endRow":0,"endColumn":62}],"imageURLs":["media/images/1647477107651-IMG_EC4A12796B6C-1.jpeg"],"videoURLs":[],"audioURLs":[],"linesAbove":"0","linesBelow":"0","currentFilePath":"/breedTemperamentIndex.sql","viewableBlogText":"CREATE INDEX BreedTemperamentIndex ON Dogs(breed, temperament);","commentTags":[],"questionCommentData":{"allAnswers":[],"correctAnswer":"","question":""}}],"ev-347":[{"id":"commentId-12","displayCommentEvent":{"id":"ev-347","timestamp":1647473082221,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":347,"type":"INSERT","fileId":"fileId-5","character":";","previousNeighborId":"ev-346","lineNumber":4,"column":25,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1647542119672,"commentText":"<div>This query, for example, uses <font face=\"Courier\">breed</font> and <font face=\"Courier\">temperament</font> together with an <font face=\"Courier\">AND</font>. This can be optimized significantly over a full table scan.</div><div><br></div><div>The <font face=\"Courier\">AND</font> is important here. If I was using an <font face=\"Courier\">OR</font> then the combination of the two attributes wouldn't be valuable in the <font face=\"Courier\">BreedTemperamentIndex</font> because the <font face=\"Courier\">rowId</font>s are sorted by <font face=\"Courier\">breed</font> first. The <font face=\"Courier\">temperament</font> can't be searched efficiently. I'll come back to this point at the end of this playback.<br></div>","selectedCodeBlocks":[{"fileId":"fileId-5","selectedText":"SELECT *\nFROM Dogs\nWHERE breed = \"Lab\" \nAND temperament = \"Calm\"","startRow":0,"startColumn":0,"endRow":3,"endColumn":24}],"imageURLs":["media/images/1647477107651-IMG_EC4A12796B6C-1.jpeg","media/images/1647477666607-Screen Shot 2022-03-16 at 6.20.12 PM.png"],"videoURLs":[],"audioURLs":[],"linesAbove":"0","linesBelow":"0","currentFilePath":"/q3.sql","viewableBlogText":"SELECT *\nFROM Dogs\nWHERE breed = \"Lab\" \nAND temperament = \"Calm\";","commentTags":[],"questionCommentData":{"allAnswers":[],"correctAnswer":"","question":""}}],"ev-366":[{"id":"commentId-13","displayCommentEvent":{"id":"ev-366","timestamp":1647473091432,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":366,"type":"INSERT","fileId":"fileId-5","character":"NEWLINE","previousNeighborId":"ev-365","lineNumber":1,"column":19,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1647477648916,"commentText":"In the attached screenshot you can see the query plan.<br>","selectedCodeBlocks":[{"fileId":"fileId-5","selectedText":"EXPLAIN QUERY PLAN","startRow":0,"startColumn":0,"endRow":0,"endColumn":18}],"imageURLs":["media/images/1647477640413-Screen Shot 2022-03-16 at 6.20.47 PM.png"],"videoURLs":[],"audioURLs":[],"linesAbove":"0","linesBelow":"4","currentFilePath":"/q3.sql","viewableBlogText":"EXPLAIN QUERY PLAN\nSELECT *\nFROM Dogs\nWHERE breed = \"Lab\" \nAND temperament = \"Calm\";","commentTags":[],"questionCommentData":{"allAnswers":[],"correctAnswer":"","question":""}}],"ev-416":[{"id":"commentId-14","displayCommentEvent":{"id":"ev-416","timestamp":1647473105140,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":416,"type":"INSERT","fileId":"fileId-6","character":";","previousNeighborId":"ev-415","lineNumber":3,"column":20,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1647478932470,"commentText":"<div>A <i>covering</i> index includes some data that is likely to be projected out in a query. For example, if the highlighted query was an important query and the Dogs table had a lot of data then the <font face=\"Courier\">BreedTemperamentIndex</font> could be used to quickly find the breed and then display the temperament. <br></div><div><br></div><div>This saves the DBMS from having to do a second search for the rows with the corresponding <font face=\"Courier\">rowId</font>s.</div>","selectedCodeBlocks":[{"fileId":"fileId-6","selectedText":"SELECT temperament\nFROM Dogs\nWHERE breed = \"Lab\"","startRow":0,"startColumn":0,"endRow":2,"endColumn":19}],"imageURLs":["media/images/1647477869435-Screen Shot 2022-03-16 at 6.21.09 PM.png"],"videoURLs":[],"audioURLs":[],"linesAbove":"0","linesBelow":"0","currentFilePath":"/q4.sql","viewableBlogText":"SELECT temperament\nFROM Dogs\nWHERE breed = \"Lab\";","commentTags":[],"questionCommentData":{"allAnswers":[],"correctAnswer":"","question":""}}],"ev-435":[{"id":"commentId-15","displayCommentEvent":{"id":"ev-435","timestamp":1647473114761,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":435,"type":"INSERT","fileId":"fileId-6","character":"NEWLINE","previousNeighborId":"ev-434","lineNumber":1,"column":19,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1647478956056,"commentText":"The attached screenshot shows that the <font face=\"Courier\">BreedTemperamentIndex</font> is being used for search and for projection.<br>","selectedCodeBlocks":[{"fileId":"fileId-6","selectedText":"EXPLAIN QUERY PLAN","startRow":0,"startColumn":0,"endRow":0,"endColumn":18}],"imageURLs":["media/images/1647477936904-Screen Shot 2022-03-16 at 6.21.35 PM.png"],"videoURLs":[],"audioURLs":[],"linesAbove":"0","linesBelow":"3","currentFilePath":"/q4.sql","viewableBlogText":"EXPLAIN QUERY PLAN\nSELECT temperament\nFROM Dogs\nWHERE breed = \"Lab\";","commentTags":[],"questionCommentData":{"allAnswers":[],"correctAnswer":"","question":""}}],"ev-518":[{"id":"commentId-16","displayCommentEvent":{"id":"ev-518","timestamp":1647477501668,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":518,"type":"INSERT","fileId":"fileId-7","character":";","previousNeighborId":"ev-517","lineNumber":5,"column":24,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1647478249491,"commentText":"Earlier I mentioned that a multi-attribute index doesn't help with a query with an <font face=\"Courier\">OR</font> like the one on the screen.<br>","selectedCodeBlocks":[{"fileId":"fileId-7","selectedText":"SELECT *\nFROM Dogs\nWHERE breed = \"Lab\"\nOR temperament = \"Calm\"","startRow":1,"startColumn":0,"endRow":4,"endColumn":23}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":"1","linesBelow":"0","currentFilePath":"/q5.sql","viewableBlogText":"EXPLAIN QUERY PLAN\nSELECT *\nFROM Dogs\nWHERE breed = \"Lab\"\nOR temperament = \"Calm\";","commentTags":[],"questionCommentData":{"allAnswers":[],"correctAnswer":"","question":""}},{"id":"commentId-17","displayCommentEvent":{"id":"ev-518","timestamp":1647477501668,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":518,"type":"INSERT","fileId":"fileId-7","character":";","previousNeighborId":"ev-517","lineNumber":5,"column":24,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1647542204466,"commentText":"The attached screenshot shows that the <font face=\"Courier\">BreedTemperamentIndex</font> cannot be used but the two separate indexes, <font face=\"Courier\">BreedIndex</font> and <font face=\"Courier\">TemperamentIndex</font>, can be used together to find all of the Labs and then all of the calm dogs.<br>","selectedCodeBlocks":[{"fileId":"fileId-7","selectedText":"EXPLAIN QUERY PLAN","startRow":0,"startColumn":0,"endRow":0,"endColumn":18}],"imageURLs":["media/images/1647478350892-Screen Shot 2022-03-16 at 7.37.47 PM.png"],"videoURLs":[],"audioURLs":[],"linesAbove":"0","linesBelow":"4","currentFilePath":"/q5.sql","viewableBlogText":"EXPLAIN QUERY PLAN\nSELECT *\nFROM Dogs\nWHERE breed = \"Lab\"\nOR temperament = \"Calm\";","commentTags":[],"questionCommentData":{"allAnswers":[],"correctAnswer":"","question":""}}]};
